import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './index.css';
import reportWebVitals from './reportWebVitals';
import Home from './Pages/Home';
import Login from './Pages/Login';
import Signup from './Pages/Signup';
import CrewLists from './Pages/CrewLists';
import MyClub from './Pages/MyClub';
import SiteInfo from './Pages/SiteInfo';
import ClubMembers from './Pages/ClubMembers';
import MemberAccount from './Pages/MemberAccount';
import AddMember from './Pages/AddMember';
import AddInfo from './Pages/AddInfo';
import ComponentLibrary from './Pages/ComponentLibrary';
import clubMemberData from "./Assets/content/club.json";

// for (let i = 0; i < clubMemberData.clubs.length; i++) {
//   let arrayPath = clubMemberData.clubs[i].path;
//   console.log(arrayPath);
// }

// let arrayPath = clubMemberData.clubs.map((i) => i.path);
let arrayPath2 = clubMemberData.clubs[0].carnlough[0].path || clubMemberData.clubs[0].cairndhu[0].path;
// const carnloughPath = clubMemberData.clubs[0].carnlough[0].path;
// const cairndhuPath = clubMemberData.clubs[0].cairndhu[0].path;
// console.log(arrayPath);
// console.log(arrayPath[0]);
// console.log(arrayPath[2]);

console.log(carnloughPath + " " + cairndhuPath);
console.log(carnloughPath || cairndhuPath);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <BrowserRouter>
    <Routes>
      <Route exact path='/' element={<Home />} />
      <Route index element={<Home />} />
      <Route path='/login' element={<Login />} />
      <Route path='/signup' element={<Signup />} />
      <Route path={`/crew-lists` + arrayPath2} element={<CrewLists />} />
      {/* <Route path={`/crew-lists` + cairndhuPath} element={<CrewLists />} /> */}
      <Route path={`/my-club` + arrayPath2} element={<MyClub />} />
      {/* <Route path={`/my-club` + cairndhuPath} element={<MyClub />} /> */}
      <Route path='/site-information' element={<SiteInfo />} />
      <Route path={`/club-members` + arrayPath2} element={<ClubMembers />} />
      {/* <Route path={`/club-members` + cairndhuPath} element={<ClubMembers />} /> */}
      <Route path={`/member-account` + arrayPath2} element={<MemberAccount />} />
      {/* <Route path={`/member-account` + cairndhuPath} element={<MemberAccount />} /> */}
      <Route path={`/add-member` + arrayPath2} element={<AddMember />} />
      {/* <Route path={`/add-member` + cairndhuPath} element={<AddMember />} /> */}
      <Route path={`/add-info` + arrayPath2} element={<AddInfo />} />
      {/* <Route path={`/add-info` + cairndhuPath} element={<AddInfo />} /> */}
      <Route path='/component-library' element={<ComponentLibrary />} />
    </Routes>
  </BrowserRouter>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
